CREATE TABLE rental_logs (
  log_id UUID PRIMARY KEY,
  rented_by VARCHAR(100),
  rental_date DATE,
  return_date DATE
);

CREATE TABLE rental_inventory (
    instrument_id INT PRIMARY KEY,
    instrument_name VARCHAR(255),
    available_quantity INT,
    rental_price DECIMAL(10, 2)
);

CREATE TABLE instrument_types (
    type_id INT PRIMARY KEY,
    instrument_type VARCHAR(255)
);

CREATE TABLE rental_customers (
    customer_id INT PRIMARY KEY,
    customer_name VARCHAR(255),
    contact_number VARCHAR(20),
    email VARCHAR(255)
);

CREATE TABLE rental_inventory ( 
  instrument_id INT PRIMARY KEY, 
  instrument_name VARCHAR(255) NOT NULL, 
  availability_status BOOL NOT NULL 
); 

CREATE TABLE customers ( 
  customer_id INT PRIMARY KEY, 
  customer_name VARCHAR(255) NOT NULL, 
  phone_number VARCHAR(20) NOT NULL 
); 

CREATE TABLE rentals ( 
  rental_id INT PRIMARY KEY, 
  customer_id INT NOT NULL, 
  instrument_id INT NOT NULL, 
  rental_date DATE NOT NULL, 
  return_date DATE, 
  FOREIGN KEY (customer_id) REFERENCES customers(customer_id), 
  FOREIGN KEY (instrument_id) REFERENCES rental_inventory(instrument_id) 
); 

CREATE TABLE rental_locations ( 
  location_id INT PRIMARY KEY, 
  location_name VARCHAR(255) NOT NULL, 
  location_address VARCHAR(255) NOT NULL 
); 

CREATE TABLE rental_history ( 
  rental_id INT, 
  rental_date DATE NOT NULL, 
  return_date DATE, 
  late_fee DECIMAL(10, 2), 
  FOREIGN KEY (rental_id) REFERENCES rentals(rental_id) 
);
